import React from 'react';

const Display = () => {
    return (<div>
        Your details:
            <div>{firstname + " " + lastname}</div>
            <div>{email}</div>
            <div>{mobile}</div>
            <div>{dob}</div>
            <div>{gender}</div>
            <div>{course}</div>
            <div>{agree}</div>

    </div>);
}

export default Display;
